import React from "react";
import HomePage from "./view/components/pages/HomePage/HomePage";
import Login from "./view/components/pages/LogInPage/LogIn";
import ForgotPassword from "./view/components/pages/ForgotPassword/ForgotPassword";
import SignUp from "./view/components/pages/SignUp/SignUp"
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.css';


function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/LogInPage">login</Link>
            </li>
            <li>
              <Link to="/ForgotPassword">ForgotPassword</Link>
            </li>
            <li>
              <Link to="/SignUp">SignUp</Link>
            </li>

          </ul>
        </nav>
        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
        <Route path="/SignUp">
            <SignUp />
          </Route>
          <Route path="/ForgotPassword">
            <ForgotPassword />
          </Route>
          <Route path="/">
            <Login />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
export default App;
